Life at 3 - episode 1

The story continues for the children of The Life Series-now they are three-as they reveal what it takes to give a child the best chance at life.

Over two episodes Life at 3 measures our group of children against the latest scientific findings on two of the hottest topics in child development-obesity and bad behaviour.

The Life Series is made in conjunction with a long-term study-Growing Up in Australia-in which 10,000 children have been placed under a sociological and scientific microscope.

Join us on the greatest journey of all-life.
